export default function AdminLogin(){
    const demoEmail = 'abc@gmail.com'
    const demoPassword = 'abc'
    const [error, setError] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const navigate = useNavigate();

    const handleVolRegister = (event) => {
        navigate('/volregister')
    }

    const handleAdminRegister = (event) => {
        navigate('/adminregister')
    }

    const handleAdminLogin = (event) => {
        navigate('/adminlogin')
    }

    const handleSubmit = (event) => {
        event.preventDefault();
        if(email === demoEmail && password === demoPassword){
            setError('');
            navigate('/allevents');
        }
        else{
            setError('Invalid email or password')
        }
    }
    return(
        <div className="login-wrapper">
            <h1>Log In Here</h1>
            <form onSubmit={handleSubmit}>
                <label>
                <p>Email</p>
                <input type="text" onChange={e => setEmail(e.target.value)} />
                </label>
                <label>
                <p>Password</p>
                <input type="password" onChange={e => setPassword(e.target.value)} />
                </label>
                <div>
                <button type="submit">Submit</button>
                </div>
                {error && <div>{error}</div>}
            </form>

            <br />
            <div>
                <button onClick={handleVolRegister}>Volunteer Registration</button>
                <button onClick={handleAdminLogin}>Admin Login</button>
                <button onClick={handleAdminRegister}>Admin Registration</button>
            </div>
        </div>
    );
}
